import Button from "@mui/material/Button";
import PropTypes from "prop-types";

const SearchAction = ({value}) => {
    return (
        <Button
            sx={{marginLeft: '40%'}}
            size="small"
            onClick={routeChange}
        >
            Search
        </Button>
    )
};

SearchAction.propTypes = {
    value: PropTypes.string.isRequired
};

export default SearchAction;
